  return (
    <>
      <Typography
        textAlign="center"
        marginTop={4}
        marginBottom={6}
        variant="h2"
      >
        Meals
      </Typography>
      <RecipeGrid type={RecipeType.Meals} />
    </>
  );
};

export default Meals;
